import React from 'react';

import './App.css';
import Header from "./components/Header/Header";
import Navbar from "./components/Navbar/Navbar";
import Profile from "./components/Profile/Profile";
import News from "./components/News/News";
import DialogsContainer from "./components/Dialogs/DialogsContainer";
import {Route} from "react-router-dom"
import Users from "./components/Users/Users";

const App = (props) => {
	let componentsDialogs = () => <DialogsContainer store={props.store} />,

		componentsProfile = () => <Profile store={props.store} />,

		componentsUsers = () => <UsersContainer store={props.store} />;

	return (
		<div className='app-wrapper'>

				<Header/>
				<Navbar store={props.store}/>

				<div className='app-wrapper-content'>

					<Route path={`/news`} component={News}/>

					<Route path={`/users`}
						   render={ () => <Users /> }/>

					<Route path={`/dialogs`} render={componentsDialogs}/>

					<Route path={`/profile`} render={componentsProfile}/>
				</div>
			</div>
	);
};

export default App;
